    our discussion with an FEC RAD analyst, this transaction represents the return
    of funds originally transferred from one authorized committee of Sean Bielat (Bielat
    for Congress 2012, C00510065) in the amount of $8,100 on 02/14/2013 to another
    authorized committee of Sean Bielat (Sean Bielat for Senate, C00541573), which
    was converted into a non-connected Committee (BEACON PAC, C00541573 on 03/07/2012.
    \ $1500 of the funds transferred represent (a) the $500 excessive portion of the
    10/26/2012 contribution of $3,000 from Lynn Risica, and (b) the $1000 excessive
    portion of the 10/19/2012 contribution of $2,000 from an unregistered local political
    committee pursuant to 2 U.S.C. 441a(a)(5) and 11 CFR 110.3(b) (see AO 2005-02
    at 7 and AO 1994-04 at 4) the Dover Republican Town Committee.  These funds were
    at all times present in the Bielat for Congress 2012 committee until transferred
    to the Sean Bielat for Senate committee, and where at all times present in that
    committee until, and continuing through, the conversion to the non-connected committee
    BEACON PAC.\n"
